import Todo from "../Todo/Todo";
const TodoList = ({ todo, remove }) => {
  return (
    <div>
      {todo.map(t => <Todo
        key={t.id}
        text={t.text}
        inYear={t.inYear}
        remove={remove}
      />)}
    </div>
  );
}

export default TodoList;
